import { useParams } from "react-router-dom";
import { MDBBtn } from 'mdb-react-ui-kit';

function Appointment(){
    const {username} = useParams();
    return(
        <div className="App">
                Doctor: {username}
                <>
                <MDBBtn className='mx-2' color='secondary'>
        Secondary
      </MDBBtn>
      </>
                

            </div>
    );
}
export default Appointment
